// src/components/WelcomeBox.js
import React from 'react';
import './WelcomeBox.css';

function WelcomeBox() {
  return (
    <div className="welcome-box">
      <p>We are</p>
      <h1>English & Creative Writing Society</h1>
    </div>
  );
}

export default WelcomeBox;
